'use strict';

let error;
function lazyError() {
  if (!error) {
    error = require('internal/errors').codes.ERR_INTERNAL_ASSERTION;
  }
  return error;
}

function assert(value, message) {
  if (!value) {
    const ERR_INTERNAL_ASSERTION = lazyError();
    throw new ERR_INTERNAL_ASSERTION(message);
  }
}

function fail(message) {
  const ERR_INTERNAL_ASSERTION = lazyError();
  throw new ERR_INTERNAL_ASSERTION(message);
}

assert.fail = fail;

module.exports = assert;

'use strict';

const binding = internalBinding('performance');
const {
  milestones,
  getTimeOrigin,
} = binding;

// TODO(joyeecheung): we may want to warn about access to
// this during snapshot building.
let timeOrigin = getTimeOrigin();

function now() {
  const hr = process.hrtime();
  return (hr[0] * 1000 + hr[1] / 1e6) - timeOrigin;
}

function getMilestoneTimestamp(milestoneIdx) {
  const ns = milestones[milestoneIdx];
  if (ns === -1)
    return ns;
  return ns / 1e6 - timeOrigin;
}

function refreshTimeOrigin() {
  timeOrigin = getTimeOrigin();
}

module.exports = {
  now,
  getMilestoneTimestamp,
  refreshTimeOrigin
};

'use strict';

const {
  prepareMainThreadExecution
} = require('internal/bootstrap/pre_execution');

prepareMainThreadExecution(true);

markBootstrapComplete();

// Note: this loads the module through the ESM loader if the module is
// determined to be an ES module. This hangs from the CJS module loader
// because we currently allow monkey-patching of the module loaders
// in the preloaded scripts through require('module').
// runMain here might be monkey-patched by users in --require.
// XXX: the monkey-patchability here should probably be deprecated.
require('internal/modules/cjs/loader').Module.runMain(process.argv[1]);

'use strict';

const { defaultGetFormat } = require('internal/modules/esm/get_format');
const { defaultGetSource } = require('internal/modules/esm/get_source');
const { translators } = require('internal/modules/esm/translators');

async function defaultLoad(url, context) {
  let {
    format,
    source,
  } = context;

  if (!translators.has(format)) format = defaultGetFormat(url);

  if (
    format === 'builtin' ||
    format === 'commonjs'
  ) {
    source = null;
  } else if (source == null) {
    source = await defaultGetSource(url, { format });
  }

  return {
    format,
    source,
  };
}

module.exports = {
  defaultLoad,
};

const cluster = require('cluster')

cluster.on('fork', () => {
  throw new Error('0x does not support clustering.')
})

'use strict';

const config = internalBinding('config');

const {
  DTRACE_HTTP_CLIENT_REQUEST = () => {},
  DTRACE_HTTP_CLIENT_RESPONSE = () => {},
  DTRACE_HTTP_SERVER_REQUEST = () => {},
  DTRACE_HTTP_SERVER_RESPONSE = () => {},
  DTRACE_NET_SERVER_CONNECTION = () => {},
  DTRACE_NET_STREAM_END = () => {}
} = (config.hasDtrace ? internalBinding('dtrace') : {});

module.exports = {
  DTRACE_HTTP_CLIENT_REQUEST,
  DTRACE_HTTP_CLIENT_RESPONSE,
  DTRACE_HTTP_SERVER_REQUEST,
  DTRACE_HTTP_SERVER_RESPONSE,
  DTRACE_NET_SERVER_CONNECTION,
  DTRACE_NET_STREAM_END
};

'use strict'
const net = require('net')

let isWorker = false
try {
  // Skip redirecting stdout in Worker threads.
  isWorker = !require('worker_threads').isMainThread
} catch (e) {}

if (!isWorker) {
  const socket = new net.Socket({
    fd: 3,
    readable: false,
    writable: true
  })
  Object.defineProperty(process, 'stdout', {
    configurable: true,
    enumerable: true,
    get: () => socket
  })
  Object.defineProperty(process.stdout, 'fd', {
    value: socket._handle.fd
  })
}

'use strict';

const {
  isMainThread,
  SHARE_ENV,
  resourceLimits,
  setEnvironmentData,
  getEnvironmentData,
  threadId,
  Worker
} = require('internal/worker');

const {
  MessagePort,
  MessageChannel,
  moveMessagePortToContext,
  receiveMessageOnPort,
  BroadcastChannel,
} = require('internal/worker/io');

const {
  markAsUntransferable,
} = require('internal/buffer');

module.exports = {
  isMainThread,
  MessagePort,
  MessageChannel,
  markAsUntransferable,
  moveMessagePortToContext,
  receiveMessageOnPort,
  resourceLimits,
  threadId,
  SHARE_ENV,
  Worker,
  parentPort: null,
  workerData: null,
  BroadcastChannel,
  setEnvironmentData,
  getEnvironmentData,
};

'use strict';

const {
  ReflectApply,
} = primordials;

class FreeList {
  constructor(name, max, ctor) {
    this.name = name;
    this.ctor = ctor;
    this.max = max;
    this.list = [];
  }

  alloc() {
    return this.list.length > 0 ?
      this.list.pop() :
      ReflectApply(this.ctor, this, arguments);
  }

  free(obj) {
    if (this.list.length < this.max) {
      this.list.push(obj);
      return true;
    }
    return false;
  }
}

module.exports = FreeList;

import parseArgs from "minimist";
import * as dotenv from "dotenv";

dotenv.config();

const args = parseArgs(process.argv.slice(2));

const PORT = args.PORT || process.env.PORT || 8080;
const MONGOPW = process.env.MONGOATLAS;

let MODO;
if (args["_"].includes("CLUSTER")) {
  MODO = "CLUSTER";
} else {
  MODO = "FORK";
}

export { PORT, MONGOPW, MODO };

import mongoose from "mongoose";

const UsuarioSchema = new mongoose.Schema(
  {
    username: { type: String, required: true },
    password: { type: String, required: true },
  },
  {
    versionKey: false,
  }
);

export default mongoose.model("Usuarios", UsuarioSchema);

import bcrypt from "bcrypt";
export function isValidPassword(user, password) {
  return bcrypt.compareSync(password, user.password);
}

export function createHash(password) {
  return bcrypt.hashSync(password, bcrypt.genSaltSync(10), null);
}

import { Router } from "express";
const homeRouter = Router();

homeRouter.get("/", (req, res, next) => {
  if (req.isAuthenticated()) {
    res.render("pages/home", {
      name: req.session.username,
    });
  } else {
    res.redirect("/login/faillogin");
  }
});

export default homeRouter;

import { Router } from "express";
const loginRouter = Router();
import { loginController } from "../controller/loginController.js";
import passport from "passport";

loginRouter.get("/", loginController.get);
loginRouter.get("/faillogin", loginController.errorLogin);

loginRouter.post(
  "/", 
  passport.authenticate("login", { failureRedirect: "/login/faillogin" }),
  loginController.postLogin
);

export default loginRouter;

import { Router } from "express";
const signupRouter = Router();
import { signupController } from "../controller/signupController.js";
import passport from "passport";

signupRouter.get("/", signupController.get);
signupRouter.get("/failsignup", signupController.errorSignup);

signupRouter.post(
  "/",
  passport.authenticate("signup", { failureRedirect: "/signup/failsignup" }),
  signupController.postsignup
);

export default signupRouter;

import { Router } from "express";
import { productosController } from "../controller/productosController.js";

const productosRouter = new Router();
productosRouter.get("/", productosController.getData);

export default productosRouter;

import { Router } from "express";
const logoutRouter = Router();

logoutRouter.get("/", (req, res) => {
  if (req.isAuthenticated()) {
    const name = req.session.username;
    req.logout((error) => {
      if (error) {
        res.json(error);
      }
      res.render("pages/logout", { name: name });
    });
  } else {
    res.redirect("/login");
  }
});

export default logoutRouter;

import { Router } from "express";
import { apiRandomController } from "../controller/apiRandomController.js";
const apiRandomRouter = Router();

apiRandomRouter.get("/", apiRandomController.get);

apiRandomRouter.post("/", apiRandomController.post);

export default apiRandomRouter;

import winston from "winston"

const logger = winston.createLogger({
  format: winston.format.json(),
  transports: [
    new winston.transports.Console({ level: "info" }),
    new winston.transports.File({ filename: "warn.log", level: "warn" }),
  ],
});

const errorLogger = winston.createLogger({
  format: winston.format.json(),
  transports: [
    new winston.transports.Console({ level: "error" }),
    new winston.transports.File({ filename: "error.log", level: "error" }),
  ],
});

export { logger, errorLogger };
